import { makeStyles } from "@material-ui/core";

export default makeStyles((theme) => ({
    container: {
        display: 'flex',
        height: '100vh',
        justifyContent: 'center',
        alignItems: 'center'
    },
    areaUpload: {
        display: 'flex',
        flexDirection: 'column'
    },
    deskripsi: {
        width: '100%'
        // border: 'none',
        // outline: 'none',
    },
    cardDeskripsi: {
        marginBottom: '20px',
    },
    cardContentDeskripsi: {
        padding: '0 20px'
    }
}))
